import React from "react";
import "./Catcard.css";

const Catcard = props => (
    <div className="card" onClick={this.props.imageClick}>
    <div className="img-container">
      <img alt={this.props.name} src={this.props.image} />
    </div>
  </div>
);

export default Catcard;
